import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Optional, for styling (you can create this file later)
import App from './App'; // Import the root App component
import reportWebVitals from './reportWebVitals'; // Optional for performance monitoring

// Render the App component into the root div in index.html
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root') // This matches the div in index.html
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
